window.bookSummaryJSON = "<p>When the magical Castle Perilous goes haywire, guests find themselves venturing into bizarre other worlds that could bring the castle crumbling down.</p> <p>Castle Perilous is a magic castle full of mystery and adventure, but sometimes even magic castles can go awry. This particular castle has the power to send its guests to 144,000 alternate worlds, each a fantastic voyage to the unknown. But each voyage seems to backfire. Computer whiz kid Jeremy is stuck on a planet of golf-playing dinosaurs. Gentrified Gene finds himself on a planet overrun with amazon women where the queen has taken a particular shine to him and only the Lord of the Castle Incarnadine can stop this witty madness from shaking Castle Kidnapped to its foundations.</p>"; 
